import React from 'react';
import { createTheme, ThemeProvider, CssBaseline, Container, AppBar, Toolbar, Typography, Button } from '@mui/material';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import StockChart from './components/StockChart';
import PredictedStockPrices from './components/PredictedStockPrices'; // Import the new component

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Router>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" style={{ flexGrow: 1 }}>
              Stock Trading Dashboard
            </Typography>
            <Button color="inherit" component={Link} to="/">Stock Chart</Button>
            <Button color="inherit" component={Link} to="/predictions">Predicted Prices</Button>
          </Toolbar>
        </AppBar>
        <Container>
          <Switch>
            <Route path="/" exact component={StockChart} />
            <Route path="/predictions" component={PredictedStockPrices} /> {/* Add route for predictions */}
          </Switch>
        </Container>
      </Router>
    </ThemeProvider>
  );
}

export default App;
